import { Routes, Route } from "react-router-dom";

import Layout from "./components/layout/Layout";
import ProductList from "./components/products/ProductList";

function App() {
  return (
    <Layout>
      <Routes>
        <Route path="/" exact element={<ProductList />} />
      </Routes>
    </Layout>
  );
}

export default App;
